func TestServer(t *testing.T) {
	defer func() {
		if err := recover(); err != nil {
			t.Fatalf("PANIC: %s", err)
		}
	}()

	var plugs []plugins.Plugin	
	plugs = append(plugs, &Plug1{})
	plugs = append(plugs, &Plug2{})

	router := gin.Default()
	New(plugs, router)
	log.SetLevel(log.DebugLevel)

	fight := gofight.New()
	for i := range testTableServer {
		fight.POST("/sorter").
			SetDebug(false).
			SetHeader(gofight.H{
				"Content-Type":"application/json",
			}).
			SetBody(testTableServer[i].Request).
			Run(router, func(res gofight.HTTPResponse, req gofight.HTTPRequest) {
				t.Logf("Response: %s. Code: %d", res.Body.String(), res.Code)
			})
	}

	time.Sleep(10 * time.Second)
}

type Plug1 struct {
	NCall int	
}

func (plug *Plug1) GetName() string {
	return "plug1"
}

func (plug *Plug1) IsThisPlugin(data *models.Data) bool {
	return data.NamePlug == "plug1"
}

func (plug *Plug1) Run(data *models.Data) ([]*models.GData, error) {
	plug.NCall += 1
	var retval []*models.GData

	if data != nil {
		var body map[string]interface{}
		ok := false
		if body, ok = data.Body.(map[string]interface{}); !ok {
				return nil, errors.New("Plugin1. La opción Body no es del tipo de dato esperado")
		}

		var vI interface{}
		if vI, ok = body["val1"]; !ok {
			return nil, errors.New("Plugin1. En la opción Body, no se encontró la opción val1")
		}

		val1, _ := vI.(string)
		if vI, ok = body["val2"]; !ok {
			return nil, errors.New("Plugin1. En la opción Body, no se encontró la opción val2")
		}
		
		val2, _ := vI.(string)

		gd1 := &models.GData {
			ContentType: "text/plain",
			ContentTransferEncoding: "7bit",
			Data: val1,
		}

		gd2 := &models.GData {
			ContentType: "text/plain",
			ContentTransferEncoding: "7bit",
			Data: val2, 
		}

		gd3 := &models.GData {
			ContentType: "text/plain",
			ContentTransferEncoding: "7bit",
			Data: data.Index, 
		}

		retval = append(retval, gd1)
		retval = append(retval, gd2)
		retval = append(retval, gd3)
	} else {
		return nil, errors.New("Plugin1. Data es nil")
	}

	return retval, nil
}

type Plug2 struct {
	NCall int	
}

func (plug *Plug2) GetName() string {
	return "plug2"
}

func (plug *Plug2) IsThisPlugin(data *models.Data) bool {
	return data.NamePlug == "plug2"
}

func (plug *Plug2) Run(data *models.Data) ([]*models.GData, error) {
	plug.NCall += 1

	var body map[string]interface{}
	ok := false
	if body, ok = data.Body.(map[string]interface{}); !ok {
		return nil, errors.New("Plugin2. La opción Body no no es del tipo de dato esperado")
	}

	var vI interface{}
	if vI, ok = body["img1"]; !ok {
		return nil, errors.New("Plugin2. En la opción Body, no se encontró la opción img1")
	}

	img1, _ := vI.(string)
	if vI, ok = body["img2"]; !ok {
		return nil, errors.New("Plugin1. En la opción Body, no se encontró la opción img2")
	}
	
	img2, _ := vI.(string)

	gd1 := &models.GData {
		ContentType: "text/plain",
		ContentTransferEncoding: "7bit",
		Data: data.Index,
	}

	gd2 := &models.GData {
		ContentType: "image/jpeg",
		ContentTransferEncoding: "base64",
		Name: "imagen1.jpeg",
		Data: img1,
	}

	gd3 := &models.GData {
		ContentType: "image/jpeg",
		ContentTransferEncoding: "base64",
		Name: "imagen2.jpeg",
		Data: img2, 
	}

	var retval []*models.GData
	retval = append(retval, gd1)
	retval = append(retval, gd2)
	retval = append(retval, gd3)

	return retval, nil
}
